la SanitÃ . <br />\r\nIn particolare mi occupo di:<br />\r\n-consulenza psicologiche;<br />\r\n-psicoterapia individuale e di coppia;<br />\r\n-psicologia infantile;<br />\r\n-percorsi di sostegno alla genitorialita;<br />\r\n-valutazioni funzionali e programmi psico educativi personalizzati con un approccio cognitivo-comportamentale integrato con i principi dell\'analisi del comportamento applicata ( ABA ) <br />\r\n','consulenza_1444039097.pdf','Dott.ssa Rosa Scaringella, Psicologa-Psicoterapeuta '),(46,'8610','Brindisi','Vico D\' Orimini , 1','Brindisi','72100','Brindisi','Ottobre- Lunedi e Venerdi','16.00- 20.00','Consulenza psicologica individuale, di coppia e familiare.','consulenza_1444039048.pdf','Dott. Ricco Davide'),(48,'8823','Lecce','via Leuca','Lecce','73100','Le','per tutto il mese di ottobre','previo appuntamento','Consulenza psicologica individuale e di coppia','consulenza_1443805870.pdf','dott.ssa Annalisa Sticchi'),(49,'8844','Bari','Via G. De Ruggiero, 5','Bari','70125','Bari','Per tutto il mese di ottobre','Si riceve per appuntamento','Per tutto il mese di ottobre, primi due incontri di consulenza  individuale gratuiti in merito a fobie, ansia e attacchi di panico, depressione, disturbi ossessivo-compulsivi. <br />\r\n<br />\r\nLa terapia cognitivo comportamentale vanta la maggiore conferma scientifica nel panorama nazionale e internazionale. Ãˆ una terapia strutturata, di breve durata e orientata al presente. Ãˆ finalizzata a modificare i pensieri e le credenze distorte, le emozioni disfunzionali e i comportamenti disadattivi, con conseguente riduzione ed eliminazione dei sintomi e miglioramenti duraturi nel tempo.','consulenza_1444037226.pdf','Dott.ssa Giada Spano, Psicologa Psicoterapeuta cognitivo-comportamentale'),(50,'7771','Studio di psicologia clinica, diagnosi e riabilitazione','Via G. di Vittorio','Lequile','73010','Lecce','1-30 ottobre','9-12; 17-19','Consulenza psicologica clinica;<br />\r\nConsulenza sui Disturbi specifici dell\'apprendimento e Disturbi del comportamento in etÃ  evolutiva.<br />\r\n<br />\r\n','consulenza_1444037131.pdf','dott.ssa Gabriella Cosma De Micheli'),(52,'7307','Liceo Scientifico \"R. Canudo\"','Via Aldo Moro,','Gioia del colle','70023','BA','05 - 28 ottobre 2015','lun - mar - mer 9.00 - 13.00','Primi colloqui gratuiti in ambito scolastico','consulenza_1444039260.pdf','Teresa Antonicelli'),(53,'9187','Studio Privato','Via Piave, 21','Galatina','73013','Lecce','1-31 Ottobre 2015','9,00/20,00','Consulenza psicologica e psicoterapica','consulenza_1444038413.pdf','dott.ssa Mariangela Bandello'),(54,'9860','Studio di psicologia','viale Liguria 20','Taranto','74121','taranto','Dal 5 ottobre al 31 ottobre','Ore 10,00/11,00','Riservato alle famiglie.<br />\r\nDedichiamo uno spazio gratuito a piccoli gruppi di condivisione delle problematiche relative ai diffcili rapporti tra genitori e figli, promuovendo il confronto e fornendo il sostegno necessario per migliorare i rapporti e la comunicazione.','consulenza_1444039986.pdf','Dott.ssa Vincenza Lomartire, Dott.ssa Valentina Barnaba'),(55,'7419','Studio privato','via roma, 45','Barletta','76121','bt','ottobre 2015','9.30-19.30','Consulenze psicologiche gratuite rivolte al bambino, all\'adulto, alla coppia e agli insegnanti','consulenza_1444042237.pdf','Dr.ssa Liliana Bruno'),(56,'7655','Studio privato','Via Piero Gobetti, 32','Molfetta','70056','Bari','dal 1 al 31 ottobre','10 - 13 / 16 - 20','Consulenze psicologiche individuali, familiari e di coppia gratuite, per tutto il mese di ottobre. ','consulenza_1444042408.pdf','dott.ssa Mariella Cuocci'),(57,'8596','Studio Nutrizione','via 95Â° Reg. Fanteria 102','LECCE','73100','Lecce;','tutto il mese di Ottobre','9-13/16-20 su appuntamento','MENS SANA IN CORPORE SANO<br />\r\nStress, ansia, problemi sul lavoro, con i figli e con i genitori... Spesso capita che il cibo diventa mezzo su cui sfogare il nostra stato emotivo. Impariamo a comprendere il problema per superarlo nel modo per n