INSERT INTO `datiEvento` VALUES (27,'10768','Alla ricerca della \"met&agrave; della mela\": essere se stessi nella coppia','Libreria Storie in Corso','Corso italia, 36','Martina franca','74015','Taranto','25 Ottobre','18:30','Seminario teorico-esperienziale sulla tematica del rapporto di coppia con particolare riferimento al ruolo che il sesso assume nella costruzione e nel mantenimento del legame. L\'obiettivo a cui giungere insieme &egrave;: \"met&agrave; della mela\", un mito da confermare o da rivisitare?','-','40.703249','17.339527','Dott.ssa Petecchia Monica, Dott.ssa Erika Vignola'),(28,'8530','Seminario di studio: \"disprassia e dintorni\"','Scuole dell\'infanzia e primarie','','Bitonto','70032','Bari','1-31 Ottobre','16:40-19:00','','-','41.107825','16.691057',''),(29,'10859','Stress e ansia','','Via martiri d\'Otranto, 14','Lecce','73100','Lecce','09 Ottobre','19.00','Incontro GRATUITO di gruppo sul tema \"Stress e ansia\".<br>La prenotazione pu&ograve; essere effettuata alla pagina http://goo.gl/forms/8q1bzMVCla o al numero 329 221 10 00.','-','40.34907','18.163704',''),(30,'10859','Psicologia e alimentazione','','Via martiri d\'Otranto, 14','Lecce','73100','Lecce','16 Ottobre','19.00','L\'incontro sul tema \"Psicologia e alimentazione\" &egrave; destinato a un gruppo limitato, pertanto &egrave; necessario prenotarsi.<br>Ci si pu&ograve; registrare alla pagina http://goo.gl/forms/NWtS5Vwrwy o telefonando al numero 329 221 10 00','-',NULL,NULL,''),(31,'10859','Il benessere nel gruppo','','Via martiri d\'Otranto, 14','Lecce','73100','Lecce','27 Ottobre','19.00','L\'incontro sul tema \"Benessere nel Gruppo\" &egrave; destinato a un gruppo limitato, pertanto &egrave; necessario prenotarsi.<br>Ci si pu&ograve; registrare alla pagina http://goo.gl/forms/H9xmDULV09 o telefonando al numero 329 221 10 00.','-',NULL,NULL,''),(32,'10601','Seminario di cinematerapia \"cinema, mente e corpo\"','','Via dante, 16','Taranto','74100','Taranto','Ottobre','18.00 - 21.00','Seminario per l\'elaborazione e la condivisione in gruppo di emozioni favorite dalla visione di opere filmiche','-','40.466359','17.24484',''),(33,'10852','Seminario \"Genitori felici: crescere felici con i propri figli\"','Studio di Psicologia Dott.ssa Santa Maggio','Via Privata Giovanni Mongiello, 31','Bitonto','70032','Ba','24/10/2015','Dalle 17:00 alle 19:00','Un seminario gratuito rivolto ai genitori che si ripropongono di vivere la propria funzione con gioia. A coloro che, pur tra alti e bassi, si appassionano al compito di \"rigenerare\" continuamente se stessi insieme ai loro figli. Il seminario &egrave; riservato ad un numero limitato di partecipanti pertanto &egrave; obbligatoria la registrazione online mediante il seguente link http://www.santamaggio.it/registrazione-evento/ o chiamando al numero 329.4355357.','evento_1444038263.pdf',NULL,NULL,'Dott.ssa Santa Maggio'),(34,'10614','Gestione dell\'ansia, dello stress ed introduzione alle tecniche di rilassamento','Centro Medex - Medicina d\' eccellenza -','Via Campi, 168','Squinzano','73018','Lecce','15/10/2015','17-19','Incontro informativo sulla gestione dell\'ansia, dello stress ed introduzione alle tecniche di rilassamento','-',NULL,NULL,'Dott.ssa Fabiana Nuccetelli, Dott.ssa Tonia Fattizzo, Dott.ssa Marcella Santoro, Dott.ssa Loredana Vespucci'),(35,'10614','Gestione del tempo e dello stress','La Feltrinelli ','Via dei Templari, 9','Lecce','73100','Lecce','22 ottobre 2015','19-21','Incontro informativo gratuito sulla gestione del tempo e dello stress','-',NULL,NULL,'Dott.ssa Fabiana Nuccetelli e Dott.ssa Tonia Fattizzo'),(36,'10614','Promozione della salute mentale, del benessere psicologico e dell\' intelligenza emotiva rivolta a bambini, adolescenti e alle loro famiglie','Centro Medex - Medicina d\'eccellenza -','Via Campi, 168','Squinzano','73018','Lecce','29/10/2015','17-19','Incontro informativo gratuito sulla promozione della salute mentale, del benessere psicologico e dell\' intelligenza emotiva 