ori ','Foggia','71122','Foggia ','31.10.2015 ','9.30-13,30 ','I disturbi psicosomatici verranno affrontati e approfonditi avvalendosi anche della presenza di specialisti. L\'occasione sarÃ  gradita per descrivere innanzitutto la natura dei disturbi psicosomatici e l\'importanza del ruolo delle emozioni. Successivamente sarÃ  trattato il tema degli \"organi bersaglio\" come sede delle somatizzazioni e in questo scenario gli specialisti tratteranno disturbi come gastriti, colon irritabile....dermatiti psicosomatiche e anche disturbi da dolore sessuale e disfunzioni sessuali di natura psicosomatica. ','evento_1445420831.pdf',NULL,NULL,'Dr.ssa Ines Panessa\\Dr. Leonardo Lauriola -Gastroenterologo\\ Dr. Alberto Di Michele- Dermatologo\\ Dr. Pietro Corsano- Ginecologo'),(42,'9110','Prima Consulenza gratuita','Studio Privato della Dott.ssa De Vito Maria Lucia Tricase','Via Gaetano Filangieri n.17 bis','Tricase','73039','Lecce','Dal 1 ottobre al 31 ottobre','Si riceve su appuntamento.','Lo studio della Dott.ssa De Vito aderisce alla campagna di sensibilizzazione e promozione del benessere psicologico dell\'Ordine Psicologi della Regione Puglia. Per tutto il mese di ottobre si offriranno consulenze gratuite di sostegno psicologico, psicoterapia e mediazione familiare.\r\nQuesta Ã¨ l\'occasione giusta per sfruttare uno spazio di ascolto, in cui iniziare a pensare al proprio benessere psicologico! ','evento_1444052369.pdf',NULL,NULL,'Dott.ssa Maria Lucia De Vito'),(43,'9110','Training Autogrno','Studio della Dott.ssa De Vito Maria Lucia Tricase','Via Gaetano Filangieri n.17 bis','Tricase','73039','Lecce','Dal 1 ottobre al 31 ottobre','Su appuntamento ','Ascoltati e respira!\r\nIn un mondo in cui siamo sempre di corsa, la genica del training autogeno migliora il contatto con se stessi e rappresenta una risorsa ,dalle immense potenzialitÃ , per aiutare la mente sia a migliorare le quotidiane performances che ad alleviare disagi psicosomatici di vario tipo.\r\nLo studio per tutto