-21.00. Necessaria la Prenotazione.','Incontro Tematico dal Titolo:<br />\r\nANSIA, FOBIA E DEPRESSIONE. CONOSCERLE PER CURARLE.','evento_1444234020.pdf',NULL,NULL,'Dott.ssa Luana Pellegrino'),(450,'9098','PRESENTAZIONE MESE DEL BENESSERE','ASSOCIAZIONE SYNEIMI','via MILANO 16','CUTROFIANO','73020','LE','9 OTTOBRE 2015','19:00','Breve introduzione al mese del benessere, spiegazione delle attivitÃ che si svolgeranno per questo periodo comunicando i recapiti per contattare i professionisti. Si parlerÃ  di benessere in generale creando, a seconda dell\'affluenza, dei giochi d\'aula per approfondire il tema del benessere, non come assenza di malessere, ma come ricerca dello stare bene nel quotidiano.','evento_1444236042.pdf',NULL,NULL,'Dott.ssa Elisa Alemanni - Dott.ssa Angelica Rajhi - Dott.re Pierluigi Congedo'),(451,'8766','Psicologia e Running','Brindisi','Via Congregazione 20','Brindisi','72100','BR','Mese di ottobre ','Previo appuntamento','La cultura, spesso tende a dividere la nostra unitÃ  organismica in due parti: il corpo e la mente.  Quasi sempre siamo portati ad identificarci con â€œil pensieroâ€, come se la nostra identitÃ  dipendesse unicamente dalla capacitÃ  di pensare, ricordare, discutere ecc; invece la nostra parte che si mette in relazione con il mondo, cioÃ¨ il corpo attraverso i suoi sensi (vista, tatto, udito, olfatto, propriocezione) tendiamo ad identificarla come â€œessoâ€. La conseguenza Ã¨ che  quando andiamo dal medico gli diciamo â€œho la pancia grassaâ€  invece di dire io sono grasso. Sembra perciÃ² che tendiamo a prendere una certa distanza dal nostro corpo come se non fossimo anche un corpo, ma la realtÃ  Ã¨ che noi siamo un corpo come siamo degli esseri che pensano. Le ricerche piÃ¹ recenti stanno spingendo gli psicologi e  i medici a considerare  lâ€™organismo come un unitÃ . Per molte teorie psicologiche non esiste divisione fra mente e corpo, e spesso i problemi nascono proprio quando tendiamo a separare le due cose. Il processo che sostiene lâ€™integrazione fra corpo e mente si realizza attraverso la consapevolezza. Lo sviluppo di essa Ã¨ uno dei principali obiettivi del â€œlavoro psicologicoâ€. Quanto piÃ¹ essa Ã¨ sviluppata, tanto piÃ¹ migliora la nostra capacitÃ  di â€œessereâ€ nel mondo nel miglior modo possibile, potenziando la nostra capacitÃ  di resistere agli stress intesi nel senso unitario (fisici e psichici). Il terapeuta aiuta e sostiene il processo mediante il quale il cliente diventa sempre piÃ¹ consapevole delle sue parti scisse (quelle parti, sia corporee che mentali, che sono fuori dalla nostra consapevolezza e spesso in conflitto fra di loro). Anche chi fa podismo a volte rischia di vivere questa esperienza vitale in maniera scissa: molti corrono con il pensiero fisso di migliorare i propri tempi senza dare ascolto al proprio corpo anzi, spesso viene vissuto come fosse una macchina che va potenziata attraverso lâ€™uso di espedienti esterni (integratori e doping), e quando arriva il dolore si cerca di alleviarlo con antinfiammatori senza dargli ascolto, quando invece egli ci lancia dei segnali. Tutto ciÃ² puÃ² portare ad infortuni oppure i benefici che se ne traggono non compensano gli effetti collaterali nocivi. Lâ€™integrazione del vissuto psicologico e corporeo, riesce a ridurre il rischio di infortuni ma anche ci aiuta a sfruttare meglio le nostre risorse e quindi a farci migliorare i risultati senza bisogno di aiuti esterni. Ma soprattutto ci aiuta a vivere la corsa come un momento di benessere e lo sforzo diventa piacevole da sopportare. In conclusione possiamo affermare che una adeguata consapevolezza della nostra corporeitÃ , puÃ² essere determinante nellâ€™affrontare meglio lo sforzo fisico e psichico durante la corsa e non solo.\r\n\r\nIn che modo un lavoro psicologico puÃ² migliorare lâ€™attivitÃ  del podista? Il â€œlavoro psicologicoâ€ consiste in un percorso di sviluppo delle condizioni che portano a fare esperienza nel presente (qui e ora) di se stessi come totalitÃ . Per chi si accinge ad affrontare questa esperienza, nelle fasi iniziali, Ã¨ facile notare come si tende a identificarsi solo con una parte di sÃ© escludendo le altre; questo dimostra di avere strutturato una modalitÃ  di contatto che esclude alcune parti di se stessi, ed in particolare della propria  corporeitÃ . Sembra come portare nel setting psicologico queste parti rinnegate un poâ€™ come se si porta allâ€™ortopedico il piede dolorante chiedendogli  di guarirlo. Lo psicologo lavora con la persona senza schierarsi con nessuna di queste parti ma cercando di favorirne la consapevolezza e permettendo che esse comunichino fra di loro. In questo modo si potranno sperimentare emozioni intense che permetteranno di integrare gli aspetti corporei e mentali del nostro vissuto, facendoci recuperare energie da utilizzare per migliorare la prestazione sportiva ma anche la nostra esistenza. ','evento_1444236680.pdf',NULL,NULL,'Dottor G. P. Settanni'),(452,'8766','La mia amica/nemica Ansia','Studio di Psicologia e Counseling','Via Congregazione 20','Brindisi','72100','Brindisi','mese di ottobre','tel. per appuntamento 3485614682','Chi non ha mai conosciuto quelle sensazioni di mancanza di respiro, palpitazioni, vampate di calore e sentimenti di paura che vanno sotto il nome di ansia? Perfino gli atleti prima di una competizione, spesso provano queste sensazioni. Essa compare anche in situazioni comuni come quando, per esempio, stiamo per incontrare una persona che riteniamo molto importante e con cui vogliamo mostrare il meglio di noi, oppure quando stiamo semplicemente facendo la spesa. Lâ€™ansia Ã¨ uno stato di attivazione del nostro organismo, di cui possiamo esserne piÃ¹ o meno consapevoli, che serve a prepararci ad affrontare situazioni in cui dobbiamo dare il meglio di noi stessi. Essa oltre ad essere un segnale, serve ad attivare tutte le funzioni fisiche e psichiche che migliorano la nostra prestazione generale. Tuttavia puÃ² diventare un ostacolo se sfugge alla nostra consapevolezza, facendoci sentire bloccati ed incapaci di reagire; questo puÃ² essere causato da abitudini acquisite nel passato e di cui non ne siamo piÃ¹ consapevoli. Per farla diventare nostra alleata Ã¨ necessario saperla riconoscere in tutti i suoi aspetti e imparare a gestirla. A tal fine esistono numerose tecniche come il Training autogeno, che si ispirano alla meditazione di origine orientale ed hanno come scopo aiutare ad acquisire maggiore consapevolezza della propria vitalitÃ ; impararle non Ã¨ difficile se si Ã¨ motivati, ma Ã¨ necessario, almeno nelle fasi iniziali, affidarsi a conduttori preparati e partecipare ad incontri in ambienti confortevoli e con gruppi di persone disposte allâ€™osservazione di se stessi.','evento_1444236700.pdf',NULL,NULL,'Dott. G. P. Settanni'),(453,'8766','A che serve lo psicologo?','Studio di Psicologia e Counseling','Via Congregazione 20','Brindisi','72100','Brindisi','mese di ottobre','tel. per appuntamento 3485614682','Qual Ã¨ la differenza fra il Medico e lo Psicologo? Cosa fa e cosa non fa lo Psicologo? Con quali competenze scientifiche?  Lo Psicologo dÃ  solo dei consigli?\r\nA queste e alle tue domande risponderemo agli incontri gratuiti che offriamo in occasione del Mese del Benessere Psicologico.\r\n','evento_1444236723.pdf',NULL,NULL,'Dott. G. P. Settanni'),(454,'9924','Consulenze e valutazioni psicologiche gratuite (etÃ  adulta ed evolutiva)','Studio di psicologia clinica e psicoterapia ad indirizzo cognitivo-comportamentale Turi','Strada Rutigliano 1a traversa sinistra, 5','Turi','70010','BA','OTTOBRE 2015','su prenotazione 3930083066','Consulenze e valutazioni psicologiche gratuite (etÃ  adulta ed evolutiva)','evento_1444320687.pdf',NULL,NULL,'Dott.ssa Donatella Marchione'),(455,'8926','Sostenere la genitorialitÃ ','Parrocchia SS.mo Redentore','Largo Giovanni Paolo II','Altamura','70022','BA','dal 15 ottobre \'15 al 31 ottobre \'15','20.00 - 21.30','Offrire uno spazio di ascolto e confronto al fine d