ne psicologica, sotto innumerevoli aspetti, rivolto essenzialmente agli studenti universitari dei corsi di psicologia (triennali e magistrali) ma aperto alla partecipazione di tutti.<br />\r\nLâ€™evento, infatti, si comporrÃ  di due differenti momenti di discussione (uno al mattino e uno al pomeriggio) in affrontare, rispettivamente, i temi dei percorsi formativi alla professione (pre- e post-lauream) e dei cambiamenti che gli psicologi dovranno affrontare nellâ€™adattare la propria professione ai bisogni e alle trasformazioni della societÃ .<br />\r\nLa prima sessione si occuperÃ  di analizzare il modo in cui oggi sono strutturati i percorsi formativi (corsi di studio triennali e magistrali, tirocini, esame di stato, specializzazioni, ecc.), esaminandoli qualitativamente e provando a capire come essi possano e debbano essere migliorati, anche adattandosi alle richieste della professione presente e futura, con uno sguardo critico rispetto a quali sono i limiti sovradeterminati che costringono spesso gli enti pubblici a doverli organizzare in un sistema di ristrettezza di risorse.  Ãˆ prevista la partecipazione, in veste di relatori, del dott. Fulvio Giardina (presidente nazionale dellâ€™Ordine degli Psicologi), del dott. Antonio Di Gioia (presidente dellâ€™Ordine degli Psicologi Puglia), della prof.ssa Rosalinda Cassibba (direttrice del Dipartimento di Scienze della Formazione, Psicologia, Comunicazione dellâ€™UniversitÃ  di Bari), dei proff. Giuseppe Mininni, Antonetta Curci e Giancarlo Tanucci (rispettivamente coordinatori o rappresentanti dei corsi di laurea in Scienze e Tecniche Psicologiche, Psicologia Clinica e Formazione e Gestione delle Risorse Umane del suddetto Dipartimento)<br />\r\nLa sessione pomeridiana invece servirÃ  per discutere quali sono, ad oggi, le prospettive per la professione psicologica, parlando degli sbocchi lavorativi e delle specializzazioni attualmente esistenti e di quelli che potranno esserci nel prossimo futuro a causa dei mutamenti sociali. Inoltre si parlerÃ  di tutti quei percorsi che, pur non rientrando direttamente nellâ€™ambito psicologico, gli sono tangenti, tanto da poter essere eventualmente intrapresi da chi sceglie la professione. Il dibattito avrÃ  anche la funzione di far riflettere gli studenti che vi parteciperanno rispetto a come strutturare la propria formazione e a come ripensare e innovare la propria figura professionale, fornendogli gli strumenti per autodeterminare il proprio percorso lavorativo, il cui concepimento Ã¨ spesso viziato da stereotipi o rappresentazioni poco veritiere. Come ospiti, dovrebbero prendervi parte il prof. Onofrio Strignano (docente di psicologia delle organizzazioni presso La Sapienza), la dott.ssa Emanuela Soleti (consigliera dellâ€™Ordine degli Psicologi Puglia) e il dott. Vincenzo Gesualdo (psicologo psicoterapeuta).<br />\r\n','evento_1444987906.pdf',NULL,NULL,'Fulvio Giardina, Antonio Di Gioia, Rosalinda Cassibba, Giuseppe Mininni, Antonietta Curci, Giancarlo Tanucci, Onofrio Strignano, Emanuela Soleti, Vincenzo Gesualdo'),(501,'8105','Bambini con difficoltÃ  di coordinazione motoria, neuroni specchio e relazioni interpersonali: quale rapporto?','Scuola Primaria \"Perotti  - Ruffo\" ','Via Convento, 156','Cassano delle Murge ','70020','Bari ','29 Ottobre 2015 ','17, 30','Si esamina il rapporto fra difficoltÃ  di coordinazione motoria, le implicazioni della  scoperta dei neuroni specchio e la capacitÃ  di comprendere ed inviare segnali non verbali nel corso di una comunicazione interpersonale.\r\n','evento_1444985000.pdf',NULL,NULL,'Dott. Donato Lauria - Psicologo e Psicoterapeuta - Servizio di Neuropsichiatria Infantile - Asl Bari'),(502,'10622','IL TRAINING AUTOGENO... UNA VIA DI BENESSERE PSICOFISICO.','SALA CONSILIARE - COMUNE DI VILLA CASTELLI','PIAZZA MINICIPIO','VILLA CASTELLI','72029','BR','31/10/2015','17.00','','evento_1444919798.pdf',NULL,NULL,'Dott.ssa MarilÃ¹ Caramia'),(503,'7653','Star bene a scuola,uno spazio dedicato agli alunni