ott.ssa Rosa Palmieri,  Edvige Zatton'),(529,'9806','Non aspettare di essere felice per essere felice','Centro Arcobaleno San Vincenzo de Paoli','Via Cavallotti, 3','Trinitapoli','76015','BAT','30/10/2015','18.30','Le persone non solo ricercano la felicitÃ   ma si sforzano anche di tenersela stretta per evitare ogni senso di infelicitÃ . Spesso questi sforzi di controllo possono diventare chiusi, rigidi ed inflessibili divenendo causa di sofferenza psicologica. L\'ACT (Acceptance and Commitment Therapy) Ã¨ un approccio psicoterapeutico su basi scientifiche che insegna modi per ridurre la lotta e l\'evitamento attraverso la consapevolezza (mindfulness), l\'accettazione e la messa in atto di comportamenti orientati ai valori. Il messaggio positivo dell\'evento Ã¨ che non c\'Ã¨ motivo di continuare ad aspettare che la vita cominci. ','evento_1445349419.pdf',NULL,NULL,'Dott. Ivan Ventura, Dott.ssa Angela Pia Landriscina'),(530,'10288','Giochi di famiglia: il difficile compito di mamma e papÃ ','Convento delle Agostiniane','Piazzetta Don Bosco','Martina Franca','74015','Taranto','29 ottobre','19.15',' ','evento_1445349529.pdf',NULL,NULL,'Brigida Ruggieri (Psicologa psicoterapeuta) - Monica Petecchia (Psicologa clinica)'),(531,'8566','OPEN-DAY: LE TECNICHE DI RILASSAMENTO. IL TRAINING AUTOGENO E LA DISTENSIONE IMMAGINATIVA.','LUC Manfredonia Peppino Impastato','Lungomare N. Sauro','Manfredonia','71043 ','FG','22 Ottobre 2015','Ore 18.00','Lo stress rappresenta una minaccia per la salute e per il benessere dell\'organismo e puÃ² produrre una lunga serie di effetti nocivi, quali l\'ansia, l\'irritabilitÃ , l\'insonnia, il mal di testa, la stanchezza diffusa e cosÃ¬ via.\r\nVi proponiamo e dedichiamo una lunga sessione pratica guidata di rilassamento psichico e fisico.\r\nVenite a trovarci. \r\nLa partecipazione Ã¨ gratuita.','evento_1445350933.pdf',NULL,NULL,'Dott.ssa Tiziana Prencipe/Dott.ssa Marialibera Pasqua/Dott. Walter Di Bitetto '),(533,'9098','Dislessia: riconoscerl